def find_divisible(nums):
    unique_nums = {}
    for num in nums:
        unique_nums[num] = False
    result = []
    for num in unique_nums:
        if num % 3 == 0:
            result.append(num)
    for i in range(len(result)):
        for j in range(i + 1, len(result)):
            if result[i] > result[j]:
                (result[i], result[j]) = (result[j], result[i])
    return result

